River Monsters: Series 2

Nature Documentary hosted by Jeremy Wade, published by ITV in 2010 - English narration


Information
------------------------------

River Monsters: Series 2
River Monsters Series 2 sees the return of host, biologist and extreme angler Jeremy Wade catching more extraordinary and supersized fish and investigating further freshwater mysteries and debunking weirder underwater myths. Jeremy will travel the globe and risk life and limb on his journey to uncover the truth about the dark secrets of our planet's rivers.
This 7-part series features mysterious predators with the potential to kill include the Giant Snakehead, Goliath Tigerfish, Stingray, Congo Catfish, Nile Perch, Sturgeon and the Zambezi Shark.




4)  Congo Killer 
Jeremy Wade travels to one of the few rivers left on earth that will still test a fisherman. The Congo, a river steeped in legends, and soaked in violence. One spirit in particular is said to lure fishermen from their boats to their death. Jeremy discovers that the truth is every bit as frightening as the myth.



